const initialState = [
  {
    id: 0,
    name: "Acha Rha'ah",
    number: 38430453,
  },
  {
    id: 1,
    name: "Kah Samma",
    number: 93856 - 354,
  },
];

const contactReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
export default contactReducer;
